(7, 1, 1, 'Asp.Net-Developer-chennai-7', 'Asp.Net Developer', 'Position:  Asp.Net Developer \r\n\r\n Designation : Asp.Net Developer\r\n\r\n Experience: (1-3) Yrs\r\n\r\n Location: Bangalore\r\n\r\nWe are in services to display Asp.Net Developer Current Openings to the market, We are looking candidates for Asp.Net Developer job openings in Bangalore for Various Clients, Apply Asp.Net Developer Jobs and and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n3 – 5 years of experience in C# and ASP.NET\r\nExperience with full application development life cycle (analysis, design, development, testing and deployment)\r\nStrong in .Net Framework, Object oriented programming, design patterns and database concepts\r\nProficient in Web Application development using ASP.NET, C# with .Net version 3.5 / 4.0/ 4.5, C#\r\nHands on Experience in Telerik Web controls\r\nExperience with MySQL, SQL server 2008 / 2012 Server and know how to build efficient queries\r\nGood knowledge in web / windows applications ,windows services and web services\r\nHands on Experience in MVC, AJAX, JQuery\r\nExcellent analytical and communication skills.\r\n\r\nAdditional skills preferred:\r\n\r\nBe a core part of a fast-paced engineering team developing new and innovative features.\r\nDevelop innovative solutions based on product requirements and business challenges.\r\nDesign and create efficient RESTful endpoints for both internal and public consumption.\r\nSelect and Implement Front-end Technologies using MVVM architecture.\r\nResearch and apply new technologies and best practices.\r\nTest-driven development to ensure code coverage and code quality.\r\nContribute in evolving our platform architecture & services.\r\nWorking independently and delivering quality code as per timelines.\r\nUnderstand the technical specification documents (Data flow Diagrams).\r\nUpgrade legacy code using newer frameworks.\r\nFamiliar with IIS and deploying code to Web Server.\r\nExperience with SCRUM development and other Agile methodologies.\r\nExperience with automated testing and writing unit tests\r\n\r\nRole Description:\r\n\r\nResponsible for creating of web applications that take into consideration all aspects of application development architecture design including - performance, scalability, coding, caching, security, encryption, session state management, and error logging and testing.\r\n\r\nDemonstrated results producer - with the ability to succeed within a disciplined, high-productivity, low-overhead development process - and have the drive and motivation to rapidly deliver high quality functionality into the hands of end users.\r\n\r\nDeliver well designed, highly unit tested, bullet-proof code.\r\n\r\n \r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1036, '2016-02-19 09:04:26', 2, '2016-08-28 16:30:12'),
(8, 1, 1, 'MS-Dynamics-Navision-Tech-Consultant-chennai-8', 'MS Dynamics Navision-Tech Consultant', 'Position: MS Dynamics Navision-Tech Consultant \r\n\r\n Designation : MS Dynamics Navision-Tech Consultant/ Senior Developer \r\n\r\n Experience: 3-8 Yrs \r\n\r\n Location: Chennai & Dubai \r\n\r\nWe are in services to display MS Dynamics Navision-Tech Consultant Current Openings to the market, We are looking candidates for MS Dynamics Navision-Techn Consultant Job Openings in Chennai & Dubai to Various Clients in India & Abroad, Apply MS Dynamics Navision-Tech Consultant Jobs and and get placed in your dreamed Organization \r\n\r\n\r\nRoles & Responsibilities:	\r\n\r\n•	Should have relevant 3+ years experience\r\n•	Should have good communication skills\r\n•	Should have been involved in at least 3-4 end to end Implementation as a technical Consultant\r\n•	Should have experience of working on different NAV versions, NAV 2009, NAV 2013, 2013 R2 and 2015, having developed customization from scratch\r\n•	Must have experience in designing reports in SSRS\r\n•	Experience of Integrating Navision with any third party applications would be an added advantage\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1027, '2016-02-07 17:46:06', 2, '2016-08-28 16:30:12'),
(9, 1, 1, 'Sr.-Front-End-Developer-chennai-9', 'Sr. Front End Developer', 'Position: Sr. Front End Developer \r\n\r\n Designation : Sr. Front End Developer \r\n\r\n Experience: (2-5) Yrs\r\n\r\n Location: Chennai, Bangalore, Hyderabad, Mumbai \r\n\r\nWe are in services to display Sr. Front End Developer Current Openings to the market, We are looking candidates for Sr. Front End Developer job openings in Chennai, Bangalore, Hyderabad, Mumbai for Various Clients, Apply Sr. Front End Developer Jobs in Chennai, Bangalore, Hyderabad, Mumbai and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\nDevelop new user-facing features\r\nBuild reusable code and libraries for future use\r\nEnsure the technical feasibility of UI/UX designs\r\nOptimize applications for maximum speed and scalability\r\nAssure that all user input is validated before submitting to back-end services\r\nCollaborate with other team members and stakeholders\r\n\r\nSkills and Qualifications: \r\n\r\nStrong understanding of JavaScript, its quirks, and workarounds\r\nExpert working experience with advanced JavaScript libraries and frameworks such as ReactJS and/or AngularJS.\r\nGood understanding of web mark-ups, including HTML5 and CSS3\r\nGood to have the knowledge of frameworks such as KnockoutJS, BackboneJS, DurandalJS etc.\r\nSound understanding of asynchronous request handling, partial page updates, and AJAX\r\nProficient understanding of cross-browser compatibility issues and ways to work around such issues\r\nFamiliarity with JavaScript module loaders, such as Require.js and AMD\r\nFamiliarity with front-end build tools, such as Grunt and Gulp.js\r\nProficient understanding of code versioning tools, such as Git / SVN\r\nGood understanding of browser rendering behaviour and performance.\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1018, '2016-01-27 17:20:10', 2, '2016-08-28 16:30:12'),
(10, 1, 1, 'Full-Stack-Python/Django-developer-chennai-10', 'Full-Stack Python/Django developer', 'Position: Full-Stack Python/Django developer \r\n\r\n Designation : Full-Stack Python/Django developer \r\n\r\n Skill Sets :  Django, MySQL, Python, HTML and CSS, JavaScript including JQuery \r\n\r\n Experience: (1-5) Yrs\r\n\r\n Location: Chennai, Bangalore, Hyderabad \r\n\r\nWe are in services to display Full-Stack Python/Django developer Current Openings to the market, We are looking candidates for Full-Stack Python/Django developer job openings in Chennai, Bangalore, Hyderabad for Various Clients, Apply Full-Stack Python/Django developer Jobs in Chennai, Bangalore, Hyderabad and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• Strong understanding of Django, MySQL, Python, HTML and CSS, JavaScript including JQuery, and workarounds\r\n• Expert working experience with advanced JavaScript libraries and frameworks such as ReactJS and/or AngularJS.\r\n• Good understanding of web mark-ups, including HTML5 and CSS3\r\n• Sound understanding of asynchronous request handling, partial page updates, and AJAX\r\n• Good understanding of browser rendering behavior and performance.\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1013, '2016-01-27 17:14:26', 2, '2016-08-28 16:30:12'),
(11, 1, 1, 'Mobile-Game-Developer-chennai-11', 'Mobile Game Developer', 'Position: Mobile Game Developer \r\n\r\n Designation : Mobile Game Developer\r\n\r\n Experience: 1-4 Yrs\r\n\r\n Location: Chennai, Bangalore\r\n\r\nWe are in services to display Mobile Game Developer Current Openings to the market, We are looking candidates for Mobile Game Developer job openings in Chennai, Bangalore for Various Clients, Apply Mobile Game Developer Jobs in Chennai, Bangalore and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• Working with team on designing, coding and unit testing specific modules of  Mobile App/Games.\r\n• Research and evaluation of technology choices\r\n• Plan your work for sprint, provide estimates and timelines and meet them\r\n• Continuously improve productivity\r\n• Self Motivated and Ability to work as Individual\r\n\r\nTechnical Skills and Personal Capabilities:\r\n \r\n• Should have minimum 1+ year(s) of experience with Mobile App/Game development\r\n• Should have Very good knowledge of C++ or Java\r\n• Should have minimum 1+ year(s) of experience with Database Fundamentals (SQL Server/MySQL)\r\n• Must show flexibility to learn & work on other technologies apart from Mobile App/Game development\r\n• Good Communication skills\r\n\r\nPreference: 	\r\n\r\n• Experience working on Multi-Platform Apps/Games\r\n• Experience in developing graphics/animation intensive games\r\n• Experience in developing Mobile Games using C++ based engines like Marmalade SDK, ShiVa3D\r\n\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1011, '2016-01-27 16:55:45', 2, '2016-08-28 16:30:12'),
(12, 1, 1, 'Drupal-Developer-chennai-12', 'Drupal Developer', 'Position: Drupal Developer \r\n\r\n Designation : Drupal Developer\r\n\r\n Experience: 2+ Yrs\r\n\r\n Location: Chennai, Bangalore, Hyderabad \r\n\r\nWe are in services to display Drupal Developer Current Openings to the market, We are looking candidates for Drupal Developer job openings in Chennai, Bangalore, Hyderabad for Various Clients, Apply Drupal Developer Jobs in Chennai, Bangalore, Hyderabad and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• Should have minimum 1+ year(s) of experience with Drupal development\r\n• Should have good working knowledge on HTML 5, CSS, J Query\r\n• Should have good experience in Database Fundamentals (SQL Server/MySQL)\r\n• Experience in developing LAMP Applications more preferred\r\n• Must show flexibility to learn & work on other technologies.\r\n• Good Communication skills\r\n• Should have graduate in Computer Science, or any related field\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1004, '2016-01-27 16:46:47', 2, '2016-08-28 16:30:12'),
(13, 1, 1, 'Sales/Marketing-Executive-chennai-13', 'Sales/Marketing Executive', 'Position: Sales/Marketing Executive \r\n\r\n Designation : Sales/Marketing Executive\r\n\r\n Experience: 1+ Yrs\r\n\r\n Location: Chennai, Bangalore\r\n\r\nWe are in services to display Sales/Marketing Executive Current Openings to the market, We are looking candidates for Sales/Marketing Executive job openings in Chennai, Bangalore for Various Clients, Apply Sales/Marketing Executive Jobs in Chennai, Bangalore and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• Identify potential leads independently through networking, cold-calling and/or other sources for the assigned territory/geography.\r\n• Identify and arrange sales meetings with target schools.\r\n• Giving product demonstrations and training as required.\r\n• Interaction with all internal departments of schools to negotiate and drive closure.\r\n\r\nDesired Profile:\r\n \r\n• Good communication skills.\r\n• Should be target achievement oriented.\r\n• Should be a team player with excellent presentation and negotiation skills.\r\n• Independent workload management skills.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 1002, '2016-01-27 16:33:06', 2, '2016-08-28 16:30:12'),
(14, 1, 1, 'Design-Engineer-chennai-14', 'Design Engineer', 'Position: Design Engineer \r\n\r\n Designation : Design Engineer\r\n\r\n Experience: 2+ Yrs\r\n\r\n Location: Bangalore\r\n\r\nWe are in services to display Design Current Openings to the market, We are looking candidates for Design Engineer job openings in Bangalore for Various Clients, Apply Design Engineer Jobs and and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\nThe Indian subsidiary is expected to have a start-up environment and thus as a Design Engineer,\r\nyou will be responsible for creating the working methodologies/culture for the R&D department.\r\nYou will be closely coordinating with Italian counterparts for the Technology Know-How transfer.\r\nRequired Qualifications:\r\nBachelor degree in Mechatronics/Electronics\r\nExperience in PCB design using EDA Software like Cadence/OrCAD\r\nSW development in C\r\nSoftware real time model based design and code generation\r\nFamiliarity in Diagnostic Protocols: UDS, KW2000\r\nFamiliarity with Safety Specifications: IEC 61508, ISO 26262, CENELEC EN 50128, FMEA,\r\nFMECA, FMEDA, FTA.\r\nFamiliarity with MISRA rules in C and Simulink/Stateflow\r\nFamiliarity with Codewarrior IDE, MPLAB IDE, IPL CANTATA , CRevs, SPLint, PC-Lint.\r\nExperience with Freescale, ST, Texas Instruments, Renesas, Micronas and Microchip\r\nprocessors\r\nFamiliarity with Electric/Electronic/ Programmable Electronic Systems\r\nMATLAB/Simulink Suite\r\nAdvanced programming in Simulink & Stateflow\r\nRealtime workshop Embedded coder\r\nFamiliarity with DSPACE Target Link\r\nFluent in English\r\n\r\nPreferred Qualifications:\r\n\r\nMaster degree in Mechatronics/Electronics\r\nExperience in a start-up environment\r\nExperience in working for a foreign company\r\nGood team player\r\nFluency in international/regional languages are highly welcome\r\nOpen minded and out of box thinker\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 999, '2016-01-27 08:10:02', 2, '2016-08-28 16:30:12'),
(15, 1, 1, 'Content-Writer-chennai-15', 'Content Writer', 'Position: Content Writer\r\n\r\n Designation : Content Writer \r\n\r\n Experience: (2-4) Yrs\r\n\r\n Location: Gurgaon, Chennai, Bangalore \r\n\r\nWe are in services to display Content Writer Current Openings to the market, We are looking candidates for Content Writer job openings in Gurgaon, Chennai, Bangalore for Various Location Clients, Apply Content Writer Jobs in Gurgaon, Chennai, Bangalore and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• Should have experience in Writing informative articles, blogs, social pages on various topics related to Stellar products/services - as per the guidelines of the Internet marketing team.\r\n• Should have experience in writing technical case studies, white papers, blogs, newsletters, and press releases \r\n• Writing creative content, tag lines - for commercial advertising of our products/services, corporate brochures and product descriptions, brand support material etc.\r\n• Developing & writing content for marketing collateral including brochures, success stories, and news items.Would be expected to create business collaterals that include brochures, fact sheets, business overview decks, client presentations\r\n• Self-edit and Proofread content once written to make it perfect and free from errors.\r\n• Excellent communication skills required\r\n• Should be creative to conceptualize ideas for internal and external events\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 998, '2016-01-27 07:45:52', 2, '2016-08-28 16:30:12'),
(16, 1, 1, 'Oracle-SCM-Functional-Consultant-chennai-16', 'Oracle SCM Functional Consultant', 'Position: Oracle SCM Functional Consultant \r\n\r\n Designation : Oracle SCM Functional Consultant \r\n\r\n Experience: (5-10) Yrs\r\n\r\n Location: Chennai, Bangalore \r\n\r\nWe are in services to display Oracle SCM Functional Consultant Current Openings to the market, We are looking candidates for Oracle SCM Functional Consultant job openings in Chennai, Bangalore for Various Location Clients, Apply Oracle SCM Functional Consultant Jobs in Chennai, Bangalore and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\n• 5+ years systems or business analysis experience with 3+ years Oracle E-Business Suite (11.5.10 and R12.1.3 required)\r\n• Experience developing and configuring in all aspects of the Software \r\n• Development Life Cycle; including requirements definition, technical designs, coding, testing and implementation\r\n• Oracle Applications implementation and upgrade projects\r\n• Experience in translating Functional specifications into Technical requirements\r\n• Bachelor''s degree in information technology or equivalent\r\n• Have the discipline to follow established methodology while seeking ways to improve the process.\r\n• Ability to work in a fast paced environment being self-motivated, pleasantly aggressive and assertive, realistically ambitious with  high personal ethics.\r\n• Proven skills in the gap analysis and gathering requirements.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 990, '2016-01-27 07:18:03', 2, '2016-08-28 16:30:12'),
(17, 1, 1, 'Web-Development-Engineer-chennai-17', 'Web Development Engineer', 'Position: Web Development Engineer \r\n\r\n Designation : Web Development Engineer \r\n\r\n Experience: (2-4) Yrs\r\n\r\n Location: Chennai, Bangalore \r\n\r\nWe are in services to display Web Development Engineer Current Openings to the market, We are looking candidates for Web Development Engineer job openings in Chennai, Bangalore for Various Location Clients, Apply Web Development Engineer Jobs in Chennai, Bangalore and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n• Should have a Master or Bachelor degree in Computer Engineering or related disciplines. \r\n• Should have previously been part of teams which have developed Web 2.0 solutions in languages such as Python or RoR, using Postgres/MySql as DB, with heavy use of client side technologies. \r\n• Should have worked with multiple JavaScript Frameworks, AJAX, MVC/MVVM frameworks, and HTML5/CSS. \r\n• Should have worked on developing for Cloud Infrastructure, Windows/Linux servers, and understanding of idiosyncrasies of various browsers. \r\n• Preferably an understanding of GIS domain and have knowledge of REST and API based development. \r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 988, '2016-01-27 06:55:50', 2, '2016-08-28 16:30:12'),
