(23, 1, 1, 'SMD-Manager-chennai-23', 'SMD Manager', 'Position: SMD Manager\r\n\r\n Designation : SMD Manager\r\n\r\n Experience: (3 -5) Yrs\r\n\r\n Location: Bangalore\r\n\r\nWe are in services to display SMD Manager Current Openings to the market, We are looking candidates for SMD Manager job openings in Bangalore for Various Clients, Apply SMD Manager Jobs and and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\nThe Indian subsidiary is expected to have a start-up environment and thus as a SMD line manager,\r\nyou will hold the responsibility of helping the company during the machine installation phase and\r\nduring the workforce recruitment phase. Once the SMD line becomes fully functional, as an SMD\r\nmanager, you will be responsible for addressing the day to day operational problems and\r\nmanaging the SMD workforce.\r\n\r\nRequired Qualifications:\r\n\r\nDiploma in Mechatronics/Electronics\r\nAt least 3 years of experience as SMT dept. manager in an ISO TS 16949 certified company\r\n?At least 3-5 years of experience in operating the SMD line (programming, setting up and\r\nrunning the production in the SMD line (From Printer to AOI)) with complete know-how on\r\nEMS Production, control processes, related registrations and statistical analysis to ensure\r\ngood and constant quality level\r\nExcellent ability in machine’s efficiency and capability monitoring (Operative knowledge on\r\nMachine, tools and production system’s maintenance and related management)\r\nAbility to manage people\r\nFluent in English\r\n\r\nPreferred Qualifications:\r\n\r\nBachelor degree in Mechatronics/Electronics\r\nExperience in a start-up environment\r\nFamiliar in using ERP systems\r\nExperience in working for a foreign company\r\nGood team player\r\nFluency in international/regional languages are highly welcome\r\nOpen minded and out of box thinker\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 948, '2015-12-19 08:53:40', 2, '2016-08-28 16:30:12'),
