loped applications/programs using Windchill API, Info*Engine Queries, Servlets, SOA & Web Services (SOAP, XML-RPC, REST), JSP, XML, XSLT, SQL, JDBC, OOAD, JSF, EJB, JMS, JMX\r\n•	Experience in any of the few following applications based on Java technologies:  Data Loading, Migration from old application to new application, Enterprise Information Integration, SAP or Oracle Apps Integration, Services, RMI Interfaces, Enterprise Information Integration, Use of Application specific APIs to customize existing application.\r\n\r\nExperience Required:\r\n•	At least 3 years of server-side/client side Windchill development experience.\r\n•	At least 3 years of development experience on enterprise applications, on Windchill platform in Windows, Linux or UNIX environment\r\n•	Experience in design, develop, test & deploy of modules/projects independently will be highly preferred\r\n•	Must have worked on bug fixing of existing modules/programs\r\n•	Fluent written & spoken English, good communications skills\r\n•	Shown excellent grasp of new technologies and applications in a short time\r\n•	Travelled onsite and performed project tasks independently – preferable\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 905, '2015-11-17 11:46:10', 2, '2016-08-28 16:30:12'),
