(36, 1, 1, 'PHP-Developer-chennai-36', 'PHP Developer', 'Position: PHP Developer\r\n\r\n Designation : Senior PHP Developer\r\n\r\n Experience: 3+ Yrs\r\n\r\n Location: Kochi\r\n\r\nWe are in services to display PHP Developer Current Openings to the market, We are looking candidates for PHP Developer for Kochi for Various Clients, Apply PHP Developer Jobs and and get placed in your dreamed Organization.\r\n\r\nRoles & Responsibilities:\r\n \r\nSenior PHP Developers with 3+ years experience and excellent knowledge in technologies like CSS3, HTML5, JavaScript, jQuery, Bootstarp, AJAX etc. Exposure to US helathcare / insurance domain is a plus.\r\nJob Description :\r\nSenior PHP Developers: Software Programmers with 3 years or above experience in any of the below development platforms.\r\n\r\nDesired Experience:\r\nGood knowledge of CSS3, HTML5, JavaScript, jQuery, Bootstarp, AJAX\r\nCoding experience in industrial software applications preferably in healthcare or related domains.\r\nExcellent understanding of complete Software Development Lifecycle (SDLC)\r\nAnalysis of reported issues for bug resolution and code correction\r\nExperience in creating business, functional and technical documentation  for the projects.\r\nExperience in working with API''s with knowledge of REST,SOAP architecture principles.\r\nExperience in creating front and back-end applications.\r\nExperience working in an Agile development methodology.\r\nStrong SQL skills with the ability to understand, analyze, DB design and write complex SQL queries and \r\ntuning the queries for optimization.\r\nExperience in writing and debugging Stored Procedures, Views , triggers, Functions\r\nObject Oriented Development - Ideal candidates should understand object oriented development, and apply OO \r\nconcepts to everything they do.\r\nShould have very good understanding about PCI standards. Exposure to EDI development,EHR/EMR,PMS,Medical \r\nbilling and coding in health care is a plus.\r\nWorking closely with other staff as project managers, designers, tester, systems analysts, and sales team \r\nin order to ensure maximum quality of software products.\r\nExcellent problem-solving and logical thinking.\r\nTo function laterally as part of a team or individually in order to meet the needs of the project.\r\nConstantly updating technical knowledge and skills by referring to the resources / online materials and \r\naccessing new applications.\r\nExcellent verbal & written communication and interpersonal skills.\r\nFlexibility to got beyond the scope of a fixed-time working pattern to meet the specific needs of the \r\nprojects.\r\nSelf motivated with a strong work ethics.\r\n\r\n\r\n \r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 859, '2015-10-27 10:09:18', 2, '2016-08-28 16:30:12'),
