(39, 1, 1, 'WiFi-Specialist-chennai-39', 'WiFi Specialist', 'Position: WiFi Specialist \r\n\r\n Designation : WiFi Domain Specialist \r\n\r\n Experience: (12 - 15) Yrs\r\n\r\n Location: Bangalore\r\n\r\n We are in services to display WiFi Specialist Current Openings to the market, We are looking candidates for WiFi Specialist Job Openings in Bangalore to Various Clients in India, Apply WiFi Specialist Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n \r\nJob Description (Role & Responsibility)\r\n\r\n•WiFi protocol development\r\n•Architect role\r\n•Discuss architecture with clients and guide the team\r\n•Development of end-to-end flow of information for managing WiFi APs remotely and building a heuristics based \r\n network controller.\r\n•Efficient methods to collect operational data from a variety of WiFI APs\r\n•Knowledge of WiFi chipsets\r\n•Identifying key parameters for network FCAPS\r\n•Development of heuristics based algorithms to provide efficient utilization of WiFi resources.\r\n\r\nPrimary Skills:\r\n\r\n•Hands-on experience in developing WiFi stack for 802.11 a/b/g/n/ac (at least last 3 years should be focused \r\n development)\r\n•Participation in multiple iterations through the evolution of WiFi AP/infrastructure\r\n•Experience in IEEE 802.11 Systems analysis including PHY and MAC\r\n•Understanding of major WiFi chipsets (Broadcom, Intel, MediaTek, etc).\r\n\r\nSecondary Skills :\r\n•Experience in development of management information agents (SNMP, CWMP, etc) is a plus \r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 849, '2015-10-19 09:46:12', 2, '2016-08-28 16:30:12'),
(40, 1, 1, 'Mechanical-Design-chennai-40', 'Mechanical Design', 'Position: Mechanical Design \r\n\r\n Designation : Mechanical Design \r\n\r\n Experience: (2 - 5) Yrs\r\n\r\n Location: Chennai\r\n\r\n We are in services to display Mechanical Design Current Openings to the market, We are looking candidates for Mechanical Design Job Openings in Chennai to Various Clients in India, Apply Mechanical Design Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n \r\n• Responsible for design of mechanical parts and mechanisms with Gears, motors, Links etc.\r\n• Design in sheet metal & plastics.\r\n• Proto development and testing.\r\n• Defining test plans and execution.\r\n• Module level project management.\r\n• Work with cross functional teams for project execution.\r\n\r\nDesired Profile :\r\n\r\n• BE - Mech with 2 to 5 yr of experience in part level or module level design.\r\n• Candidate working in a product company preferred.\r\n• Experience in Windchill.\r\n• Should have good working experience in PRO-E Wildfire 2 and above.\r\n• Experience in design of links & mechanism, Plastics and sheet metal.\r\n• Good communication skill.\r\n• Should be highly energetic and multitasking.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 843, '2015-10-08 09:12:55', 2, '2016-08-28 16:30:12'),
(41, 1, 1, 'PHP-Developer-chennai-41', 'PHP Developer', 'Position: PHP Developer \r\n\r\n Designation : PHP Developer \r\n\r\n Experience: 2+ Yrs\r\n\r\n Location: Delhi\r\n\r\n We are in services to display PHP Developer Current Openings to the market, We are looking candidates for PHP Developer Job Openings in Delhi to Various Clients in India, Apply PHP Developer Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n \r\nShould have minimum 2 yrs of experience in Core PHP.\r\n5 Yrs of working experience on any of (atleast one) CMS like wordpress/Drupal/Magento/Cake PHP.\r\nStrong understanding of MVC Architecture and experience on any of (atleast one)zend,smarty,codeigniter.\r\nWorking knowledge of object oriented programming concepts and techniques using PHP 4 and PHP 5.\r\nStrong knowledge of Javascript,XHTML,CSS,Ajax,SQL.\r\nAbility to Extend functionality i.e.Payment options,promotions etc.\r\nProficient to work with E-Commerce.\r\nExperience in debugging code.\r\nExcellent analytic and logical skills.\r\nExcellent communication skills,self motivator,team player.\r\nAbility to solve complex problems,design and requirements documentation.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 840, '2015-10-06 11:27:02', 2, '2016-08-28 16:30:12'),
