(43, 1, 1, 'Oracle-SCM-Consultant-chennai-43', 'Oracle SCM Consultant', 'Position: Oracle SCM \r\n\r\n Designation : Oracle SCM Consultant \r\n\r\n Experience: 5-8 Yrs\r\n\r\n Location: Chennai\r\n\r\n We are in services to display Oracle SCM Consultant Current Openings to the market, We are looking candidates for Oracle SCM Consultant Job Openings in Chennai to Various Clients in India, Apply Oracle SCM Consultant Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n\r\n•Oracle Sourcing\r\n•Oracle Procurement Contracts\r\n•Oracle Service Procurement\r\n•Minimum 5 years of experience in the relevant areas mentioned below.\r\n•Hands-on experience in Oracle eBusiness Suite 11i, R12\r\n•Expertise in a few of the following modules / functionality – Oracle Service Procurement, Oracle iSupplier, Oracle \r\n iProcurement, Oracle Procurement Contracts and Oracle Sourcing. \r\n•At least 2 full implementation experience. \r\n•Ability to interact with key senior business users, map Business Requirements into Functional Solutions in Oracle \r\n e-Business Suite and identify gaps and suggest functional solutions.\r\n•Knowledge of Oracle eBS SCM-related Business Flows and the related functionalities.\r\n•Knowledge of AIM and other Oracle Standard Implementation methodologies.\r\n•In-depth understanding of Organization structure, Multi-Org Concepts, its implementation and impacts.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 835, '2015-10-05 07:18:18', 2, '2016-08-28 16:30:12'),
(44, 1, 1, 'SQL-Manager-chennai-44', 'SQL Manager', 'Position: SQL Manager \r\n\r\n Designation : SQL Manager \r\n\r\n Experience: 5-8 Yrs\r\n\r\n Location: Bangalore\r\n\r\n We are in services to display SQL Manager Current Openings to the market, We are looking candidates for SQL Manager Job Openings in Bangalore to Various Clients in India, Apply SQL Manager Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n\r\nUnderstand data & how business objectives can be managed through it.\r\nFine tune the execution plan for SQL queries to improve performance and response time.\r\nAccommodate the needs of the developers.\r\nHaving good analytical and DB programming capabilities.\r\nGood communication of design to developers, through pseudocode.\r\nKnowledge of PostgreSQL.\r\nStrong Knowledge of data modeling , data normalization and performance optimization techniques.\r\nReview & approve test cases\r\nAbility to guide/mentor juniors in building solutions & troubleshooting.\r\n\r\nDesired Candidate Profile:\r\nWorking knowledge of PostgreSQL.\r\n\r\nKey Responsibilities: \r\nDesigns Data Architectures documents.\r\nDesigns and builds relational databases.\r\nDevelops strategies for data acquisitions, archive recovery, and implementation of a database.\r\nData Analysis, Database modeling & design.\r\nAble to write pscedocode to support building database objects.\r\nFine tune SQL queries to improve performance & response time.\r\nHaving good analytical and DB programming capabilities.\r\n\r\nSkills Required: \r\nDesigns database, data models, ETL processes, data warehouse applications and BI reports through the use of best practices and tools.\r\nDelivers high quality outcomes including ETL processes, data warehouse designs and data system enhancements in accordance with existing standards and guidelines.\r\nAddressing routine issues with subordinates and other technology teams by providing best practices, methods and approaches.\r\nAnalyzes business needs, works with product management to make decisions and recommendations on the future developments.\r\nCleans and maintains the database by removing and deleting old data.\r\nRelies on experience and judgment to plan and accomplish goals.\r\nA wide degree of creativity and lateral thinking is expected.\r\nPrepare unti test plan, review & approve test cases.\r\nAbility to guide/mentor juniors in building solutions & troubleshooting.\r\nExperience in data migration, database change management and data management through the various stages of the development life cycle.\r\nShould have the ability to handle multiple data projects and deadlines.\r\nShould possess good communication skills.\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 831, '2015-09-28 11:50:42', 2, '2016-08-28 16:30:12'),
(45, 1, 1, 'ERP-Solution-Architect-chennai-45', 'ERP Solution Architect', 'Position: ERP Solution Architect \r\n\r\n Designation : Senior Solution Architect \r\n\r\n Experience: 8+ Yrs\r\n\r\n Location: Bangalore\r\n\r\n We are in services to display ERP Solution Architect Current Openings to the market, We are looking candidates for ERP Solution Architect Job Openings in Bangalore to Various Clients in India, Apply ERP Solution Architect Jobs and and get placed in your dreamed Organization \r\n\r\nRoles &amp; Responsibilities:\r\n\r\nThe senior architect will play a vital role in developing analytical and ERP platforms for various retail clients across the globe. He or she will be responsible for designing and leading various projects that will involve deploying mathematical algorithms and models as web applications.\r\nResponsibilities:\r\n•Design and development of software platforms/products/product components using Java EE.\r\n•Participate in a midsized, experienced & energetic team on a rapid, agile development schedule.\r\n•Identifies user requirements by researching and analyzing user needs, preferences, objectives, and working \r\n methods; studying how users consume content, including data categorization and labeling; meeting with focus \r\n groups.\r\n•Drive the architecture finalization effort. Able to understand the current client landscape, drive the proof of \r\n concepts, if required, identify the re-usable components, employ best practices towards this effort.\r\n•Enhances information architecture team accomplishments and competence by planning delivery of solutions; answering \r\n technical and procedural questions for less experienced team members; teaching improved processes; mentoring team \r\n members.\r\n•Plans information architecture by studying the site concept, strategy, and target audience; envisioning \r\n architectural scheme, information structure and features, functionality, and user-interface design; creating user \r\n scenarios; preparing data models; designing information structure, work-and dataflow, and navigation; evaluating \r\n information representation; conducting creative meetings.\r\n•Organizes information by translating user behavior into media structure and elements; crafting interactive \r\n experiences; producing workflow diagrams, user scenarios, flowcharts, and storyboards; preparing interaction \r\n specifications, navigation rules, organization of information, and site maps; coordinating with business, \r\n technology, visual, structural, editorial, cognitive, and brand strategists.\r\n•Implements information architecture by preparing paper and interactive prototypes and mockups including page  \r\n layout and navigational elements; coordinating with Web Producer and Production Developer to integrate site \r\n concept, visual design, writing, interface, and navigational structure; documenting structure and processes.\r\n•Validates information delivery by developing and completing usability test plans; evaluating traffic patterns; \r\n studying user feedback; coordinating with Usability Specialists.\r\n•Updates job knowledge by tracking research regarding web design and usability; participating in educational \r\n opportunities; reading professional publications; maintaining personal networks; participating in professional \r\n organizations.\r\n•Enhances organization reputation by accepting ownership for accomplishing new and different requests; exploring \r\n opportunities to add value to job accomplishments.\r\n•Work in a cross functional role in collaboration with business analytics teams.\r\n•Lead a team of software developers to provide technical direction.\r\n\r\nMinimum requirements:\r\n\r\n•Graduate (BE/B.Tech)/ Masters (ME/M.Tech/MS) in Computer Science or equivalent from a premier institute with 8+ \r\n year’s hands-on software development experience.\r\n•Strong knowledge in best practices of software architecture and design.\r\n•Experience in enterprise architectur