(66, 1, 1, 'Sales-Manager-chennai-66', 'Sales Manager', 'Position: Sales \r\n\r\n Designation : Sales Manager  \r\n\r\n Experience: 10+ Yrs \r\n\r\n Location: Chennai, Bangalore \r\n\r\n We are in services to Sales Manager Current Openings to the market, We are looking candidates for Sales Manager Openings in Chennai, Bangalore, to Various Clients in India, Apply Sales Manager Jobs and and get placed in your dreamed Organization \r\n\r\nOverview:	\r\n\r\nThe Senior Sales Manager maintains and expands relationships with strategically important large customers across the identified segment. \r\nIs responsible for achieving sales quota and assigned strategic segment objectives, through Hunting.\r\nThe Senior Sales Manager represents the entire range of company products and services to assigned customers / territory, while leading the customer account planning cycle and ensuring assigned customers’ needs and expectations are met by the company.\r\nThe Senior Sales Manager reports to the Director of Sales.\r\n\r\nRoles & Responsibilities:	\r\n\r\nEstablishes CXO level relationships and able to handle independently\r\nEstablishes productive, professional relationships with key personnel in assigned segment accounts.\r\nCoordinates the involvement of company personnel, including support, service, and management resources, in order to meet account performance objectives and customers’ expectations.\r\nMeets assigned targets for profitable sales volume and strategic objectives in assigned segment / territory.\r\nProactively leads a joint company-strategic segment /account planning process that develops mutual performance objectives, financial targets, and critical milestones for a one year period.\r\nProactively assesses, clarifies, and validates customer needs on an ongoing basis.\r\nLeads solution development efforts that best address customer needs, while coordinating the involvement of all necessary company personnel.\r\n\r\nAccountabilities and Performance Measures:	\r\