(81, 1, 1, 'Postgres-DBA-chennai-81', 'Postgres DBA', 'Job Position:Postgres DBA\r\n\r\nExperience :2+ Years & Above\r\n\r\nQualification  : Any Graduates\r\n\r\nLocation : Chennai,Bangalore\r\n\r\nJob Description :\r\n\r\n1.Linux/UNIX expertise\r\n\r\n2.Expert in postgresql >=8.4\r\n\r\n3.Expert in SQL and PG/PL SQL\r\n\r\n4.Ability to set up audit trails for Postgres using functions and triggers\r\n\r\n5.Ability to independently monitor and administrator databases.\r\n\r\n6.Ability to Create Database, Create users and grant appropriate privileges\r\n\r\n7.Ability to identify defects in the environment and proactively intervene to reduce downtime.\r\n\r\n8.Performance tuning, Query Tuning by generating and explaining EXPLAIN PLAN for SQL queries.\r\n\r\n9.Expert in DBA functions like managing databases, backups & restore, scheduling jobs, space, performance management, principles of database replication, scalability and high availability.\r\n\r\n10.Expert in Backup & Recovery including Pg dump, setting up WAL archiving, Point in time recovery.\r\n\r\n11.Monitoring Alert Log, scheduled jobs and troubleshooting database problems.\r\n\r\n12.Understanding of basic database fundamentals: multi-version control, concurrency, transactions, indexing, locking, caching.\r\n\r\n13.Analyze, recommend, and implement configuration for Optimized Performance.\r\n\r\n14.Ability to plan hardware capacity requirements for storage, memory and CPU Cycles.\r\n\r\n15.Expert with setting and trouble shoot replication.\r\n\r\n16.Ability to configure and trouble shoot, log shipping, cascading standbys, partial replication, continuous recovery, detach and reattach slaves.\r\n\r\n17.Plan, manage, and execute large scale projects.\r\n\r\n18.Understanding of Unix environment with shell scripting.\r\n\r\n19.Other duties as per requirement.\r\n\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 404, '2014-12-19 13:22:23', 2, '2016-08-28 16:30:12'),
