(95, 1, 1, 'MS-SQL-Server-&-SSRS-Developer-chennai-95', 'MS SQL Server & SSRS Developer', 'Designation : MS SQL Server & SSRS Developer\r\nExperience : 2-10 Yrs\r\nLocation : Chennai &amp; Bangalore\r\n\r\nWe are in services to display MS SQL Server & SSRS Developer Current Openings to the market, We are looking candidates for MS SQL Server & SSRS Developer Job Openings in Chennai, Bangalore,Mumbai to Various Clients in India, Apply MS SQL Server & SSRS Developer Jobs and and get placed in your dreamed Organization\r\n\r\nJob Description\r\n•	SQL Reporting services 2005 or higher (SSRS)\r\n•	Creating / Deploying Report\r\n•	T-SQL for MS SQL-Server 2005 or higher\r\n•	Creating / Debugging SPs, Functions, Views, SQL Jobs,\r\n•	Able to query complex databases for fault finding, reporting, data extracts and problem resolution purposes\r\n•	SQL Performance Tuning\r\n•	MS SQL-Server tools (profiler, execution plan analysis)\r\n•	Exposure and understanding of support process\r\n•	Should create reports to be published on to a Report Server using Microsoft or Other design tools that use Report Definition Language (RDL), an XML-based industry standard used to define reports.\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 27, '2014-11-12 07:55:05', 2, '2016-08-28 16:30:12');
