(96, 1, 1, 'Share-Point-Developer-chennai-96', 'Share Point Developer', 'Designation : Share Point Developer\r\nExperience : 3-6 Yrs\r\nLocation : Chennai &amp; Bangalore\r\nSkills : Share Point Development, Maintenance Activities, Communication Skills\r\n• Experience of above 3 years in share point development\r\n• Experience in working application and maintenance\r\n• Excellent command over oral and written English.\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 24, '2014-11-12 07:54:36', 2, '2016-08-28 16:30:12'),
(97, 1, 1, 'MS-Dynamics-AX-Consultant-chennai-97', 'MS Dynamics AX Consultant', 'Designation : MS Dynamics AX Consultant\r\nExperience : 3-7 Yrs\r\nLocation : Chennai &amp; Bangalore\r\nSkills : MS Dynamics AX\r\n• Experience of above 3 years in share point development\r\n• Experience in working application and maintenance\r\n• Excellent command over oral and written English.\r\n• Basic Understanding of Functional Modules of AX2012\r\n• 3 to 5 years of Relevant Experience in Microsoft AX ( Version 2009 through 2012)\r\n• Should have expertise and Certification in Morph X++\r\n• Should have expertise on Reporting and analytics – Microsoft SQL Server Analysis Services, &amp; SQL Server Reporting Services\r\n• Should have at least 3 full cycle Implementations in AX and Support Projects\r\n• Should have good written and verbal language fluency.\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 20, '2014-11-12 07:51:45', 2, '2016-08-28 16:30:12'),
(98, 1, 1, 'Delphi-Developer/-Sr.-Developer-chennai-98', 'Delphi Developer/ Sr. Developer', 'Designation : Delphi Developer and Sr. Developer\r\nExperience : 1-7 Yrs\r\nLocation : Chennai\r\n• Very Strong experience in Delphi.\r\n• Hands on experience in SQL Server 2005/2008\r\n• Should have very good knowledge in OOPS\r\n• Should able to handle task independently\r\n• Should Posses good communication skills (both Verbal and written)\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 14, '2014-11-12 07:49:54', 2, '2016-08-28 16:30:12'),
(99, 1, 1, 'Linux-Administrator-chennai-99', 'Linux Administrator', 'Designation : Linux Administrator\r\nExperience : 3-7 Yrs\r\nLocation : Chennai,Bangalore\r\n• Should able to manage switches &amp; Routers.\r\n• Should able to manage Cloud, Mail, LAMP &amp; DNS servers independently\r\n• Should have very good knowledge in LINUX Commands\r\n• Should Posses good communication skills (both Verbal and written)\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 0, 1, '0', 12, '2014-11-12 07:49:01', 2, '2016-08-28 16:30:12'),
(104, 1, 1, 'Ticketing-Executive-chennai-104', 'Ticketing Executive', 'Position: Ticketing Executive \r\n\r\n Designation : Ticketing Executive\r\n\r\n Experience: (2-5) Yrs\r\n\r\n Location: Chennai\r\n\r\nWe are in services to display Ticketing Executive Current Openings to the market, We are looking candidates for Ticketing Executive job openings in Chennai for Various Clients, Apply Ticketing Executive Jobs and and get placed in your dreamed Organization.\r\n\r\nJob responsibilities:\r\n\r\nTo understand and taking care of smooth functioning of Queries of the Corporate.\r\nExpertise in Reservation & Ticketing, and Invoicing.\r\nError free ticket issuance\r\nCo-ordination with documentation staff for travel related services\r\nAdherence to ticketing rules and reputation as per IATA\r\nCo-ordination with airlines for deals/ ADMs / ADM resolve for the team\r\nTracking and collection of refunds\r\nExplore more areas of revenue with the existing customers (e.g. Insurance/ Leisure/)\r\n\r\nSkill Sets\r\n\r\nMinimum 2 years experience in a Travel Agency\r\nGood knowledge of Amadeus & Abacus required.\r\nWell versed in International Routing and ticketing.\r\nKnowledge of Visa documentation required.\r\nExcellent interpersonal skills\r\nCustomer service skills\r\nCustomer facing skills. Be able to provide excellent customer service both in person and by phone/email\r\nFluent spoken English and good communicative English\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '2', '5', '', '', 0, 1, 1, '0', 1047, '2016-02-28 17:55:07', 2, '2016-08-28 16:30:12'),
(105, 1, 1, 'IOS-Developer-chennai-105', 'IOS Developer', 'Position: IOS Developer \r\n\r\n Designation : IOS Developer \r\n\r\n Experience: (3-10) Yrs\r\n\r\n Location: Bangalore, Chennai\r\n\r\nWe are in services to display IOS Developer Current Openings to the market, We are looking candidates for IOS Developer job openings in Bangalore for Various Clients, Apply IOS Developer Jobs and and get placed in your dreamed Organization.\r\n\r\nRoles & Responsibilities\r\n\r\nDeliver super awesome iOS apps on time, all the time *Work either independently or in a team *Closely engage with the client from requirements until the app store *Be a rock star at integration of IOS SDKs & Frameworks *Provide super - creative design inputs to the client\r\n\r\nRequirements (Exp 3 to 10 Years)\r\n\r\nMust have 2+ experience in Independently developing iOS Native app using Objective-C with iOS SDK *Experience with Xcode, Swift/Objective-C, iOS SDK.\r\nExpert UI development for iOS using UIKit and should have worked on custom UI development for iOS.\r\nExperience working with Autolayout, size classes etc to create single interface of the application that works well in iPhone and iPad.\r\nStrong experience working with Web service to connect iOS application with the backend Services.\r\n*Strong understanding of Object oriented design principles.\r\n*Knowledge of SQL Lite, core data for iPhone.\r\n*Excellent optimization and debugging skills.\r\n*Excellent communication skills.\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1052, '2016-03-22 14:24:31', 2, '2016-08-28 16:30:12'),
(106, 1, 1, 'Product-Manager-chennai-106', 'Product Manager', 'Position: Product Manager \r\n\r\n Designation : Product Manager \r\n\r\n Experience: (7-12) Yrs\r\n\r\n Location: Chennai \r\n\r\nWe would like to show off our current opening (Product Manager Position) to the job seekers all around India. We are looking Product Manager for Chennai location for our Client. Apply for Product Manager Job and get placed with leading product development companies.\r\n\r\nRoles & Responsibilities\r\n\r\n•	5 to 12 years experience as a Java/PHP developer with excellent Programming skills (If has both the coding knowledge, would be highly preferred)\r\n•	Thorough understanding of Collections and Concurrency\r\n•	Algorithms, Design Patterns, Multithreading, Data Structures\r\n•	Experience with any framework (Java/PHP or Both)\r\n•	Experience working with relational databases/SQL\r\n•	Good Analytical and problem solving skills.\r\n•	Good Communication skills\r\n•	Passionate and committed with strong sense of ownership and craftsmanship.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1068, '2016-03-24 19:34:22', 2, '2016-08-28 16:30:12'),
(107, 1, 1, 'PHP-Developer-chennai-107', 'PHP Developer', 'Position: PHP Developer \r\n\r\n Designation : PHP Developer \r\n\r\n Experience: 3+ Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display PHP Developer Current Openings to the market, We are looking candidates for PHP Developer job openings in Chennai for Various Clients, Apply PHP Developer Jobs and and get placed in your dreamed Organization.\r\n\r\nRoles & Responsibilities\r\n\r\nWere looking for adaptive, self- motivated, detail oriented team lead who will manage the team of developers to build new features and functionality and should have strong communication skills. \r\n\r\nMentoring and leading the team of HTML & PHP developers and impart practical solutions to meet the company business goals. \r\nMust have Experience of Team Handling and International Client Handling and can work hands on.\r\nBe able to demonstrate effective oral and written communication ability covering all routine activities and contacts.\r\nEstablishing good communication with other departments.\r\nResponsible for managing the entire SDLC process for software products and/ or projects.\r\nDemonstrated ability to deliver working solutions on a tight schedule.\r\n\r\nDesired Skills and Expertise:\r\n \r\nWe are looking for Aggressive, Multi-tasking, Dedicated and Hardworking Candidates with these expertise - \r\nHaving core knowledge of PHP along with experience on JQuery, Angular JS, NodeJs and PHP framework.\r\nProficient in database concepts and working experience with MYSQL, CSS and AJAX and Bootstrap Framework.\r\nExperience in common third-party APIs and hands on MVC Architecture framework’s\r\nValue Addition:Documentation, Performance Improvement & Approach Maintaining detailed records of every activity, day to day operational work.\r\nKnowledge of SVN, GIT\r\nExperience on working with Project Management and Bug Tracking tools.\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1081, '2016-04-10 04:57:41', 2, '2016-08-28 16:30:12'),
(108, 1, 1, '.Net-Windows-Application-Developer-chennai-108', '.Net Windows Application Developer', 'Position: .Net Windows Application Developer\r\n\r\n Designation : .Net Windows Application Developer\r\n\r\n Experience: 2-5 Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display .Net Windows Application Developer Current Openings to the market, We are looking candidates for .Net Windows Application Developer job in Chennai for Various Clients, Apply .Net Windows Application Developer Jobs and and get placed in your dreamed Organization.\r\n\r\nRoles & Responsibilities\r\n\r\n•	Should be well versed in winform development with .Net Framework\r\n•	Expertise in VB.Net or C#\r\n•	Must have good programming knowledge in system or Window services\r\n•	Very good knowledge MS SQL Server (Queries, Triggers, Procedures, View, Query optimization)\r\n•	Should have worked on Crystal Report or SSRS\r\n•	Having knowledge on Network communication like UDP/TCP/HTTP/FTP would be added value (Not Mandatory)\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1084, '2016-04-15 14:23:48', 2, '2016-08-28 16:30:12'),
(109, 1, 1, '.Net-Windows-Application-Lead-chennai-109', '.Net Windows Application Lead', 'Position: .Net Windows Application Lead\r\n\r\n Designation : .Net Windows Application Lead\r\n\r\n Experience: 8-12 Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display .Net Windows Application Lead Current Openings to the market, We are looking candidates for .Net Windows Application Lead job in Chennai for Various Clients, Apply .Net Windows Application Lead Jobs and get placed with leading product development company.\r\n\r\nRoles & Responsibilities\r\n\r\n•	Should be well versed in winform development with .Net Framework\r\n•	At least 3 Years Development Experience with VB.Net, SQL Server and SQL Syntax\r\n•	Strong experience with object-oriented concepts and best practices\r\n•	Must have good programming knowledge in system or Window services\r\n•	Very good knowledge MS SQL Server (Queries, Triggers, Procedures, View, Query optimization)\r\n•	Should have worked on Crystal Report or SSRS\r\n•	Familiar with software development methodology (Agile and Scrum)\r\n•	Requirement gathering, Code Review, Handling meeting with US team & Handling development team\r\n•	Should have very good communication\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1090, '2016-04-17 07:06:06', 2, '2016-08-28 16:30:12'),
(110, 1, 1, 'Junior-Java-Developer-chennai-110', 'Junior Java Developer', 'Position: Junior Java Developer \r\n\r\n Designation : Junior Java Developer \r\n\r\n Experience: (0-2) Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display Junior Java Developer Current Openings to the market, We are looking candidates for Junior Java Developer job openings in Chennai for Various Clients, Apply Junior Java Developer Jobs and and get placed in your dreamed Organization\r\n\r\nRoles & Responsibilities\r\n\r\nJava, Core Java, Strong knowledge in OOPs concepts, J2EE,HTML,CSS,SQL\r\nOPTIONAL: IOS Objective C, Spring, Hibernate\r\nM.E. candidates are preferrable.\r\nShould be well versed in variety of technologies\r\nShould have designed at least one project module using object oriented analysis and design techniques\r\nSound knowledge of modern software architecture and development techniques\r\nGood coding skills: Implementing UI validations.\r\nshould be a go getter and interested in learning new technologies.\r\nRound (1): Optional quiz pattern\r\nRound (2): Write and solve the program in JAVA\r\nRound(3): Execute the program in system\r\nRound(4): F2F Interview\r\nCommunication Skills must be good\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 20, 3, 1, '0', 1103, '2016-04-18 06:00:55', 2, '2016-08-28 16:30:12'),
(111, 1, 1, 'Progress-DBA-chennai-111', 'Progress DBA', 'Position: Progress DBA \r\n\r\n Designation : Progress DBA \r\n\r\n Experience: (3-7) Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display Progress DBA Current Openings to the market, We are looking candidates for Progress DBA job openings in Chennai for Various Clients, Apply Progress DBA Jobs and and get placed in your dreamed Organization\r\n\r\nRoles & Responsibilities\r\n\r\nLive DB Startup & Shutdown\r\nWebspeed / Appserver / Tomcat / Progress admin server start/stop maintenance\r\nWeb speed broker Modification\r\nMonitoring database extents, before image files, after image files archive, after image files Rollforward\r\nDatabase before Image File Truncation\r\nDatabase Schema level changes\r\nDatabase Full and Incremental backups\r\nAll DB related scripts maintenance\r\nNew Environment creation (DB,.NET Instance, Propath, First time program compilation/setup)\r\nBatch Job development\r\nBatch Job setup \r\nApplication Programs code compilation\r\nLower Environments Deployment (Non-Apps programs)\r\nLower Environment DB refresh\r\nProduction Change execution (Apps changes and Non-Apps changes)\r\nDisaster Recovery Environment creation/maintenance\r\nDB / Unix hung session removal\r\nDB locking issue – support\r\nDatabase Dump & Load / Index Rebuild\r\nSupport Database performance fine tuning\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1123, '2016-04-30 11:19:35', 3, '2016-08-28 16:30:12'),
(112, 1, 1, 'Senior-Java-Software-Engineer-chennai-112', 'Senior Java Software Engineer', 'Position: Senior Java Software Engineer \r\n\r\n Designation : Senior Java Developer \r\n\r\n Experience: (2-5) Yrs\r\n\r\n Location: Chennai \r\n\r\nWe are in services to display Senior Java Developer Current Openings to the market, We are looking candidates for Senior Java Developer job openings in Chennai for Various Clients, Apply Senior Java Developer Jobs and and get placed in your dreamed Organization\r\n\r\nRoles & Responsibilities\r\n\r\nVery good hands-on experience in OOPS Concepts is required.\r\nDevelopment experience in Core Java, Hibernate, Spring, Java Script, AJAX and JSON is required.\r\nDevelopment experience in Tomcat and JQuery is desirable.\r\nStrong hands-on experience in either Front-end skills (Java Script, AJAX, JSON) or Server-side skills (Core Java, Hibernate, Spring) is a must.\r\nExperience in DICOM, HL7, Multi Planar Reconstruction (MPR) and 3D rendering will be a plus.\r\nAbility to document requirements & design specifications is a plus.\r\nMust have excellent problem solving skills.\r\nGood verbal and written communication skills.\r\nSpecific responsibilities include designing, documenting, implementing and refactoring software applications and components.\r\nWriting requirement and design specifications.\r\nInteracting with client services staff to help diagnosing and correct customer problems.\r\nShould be well versed in variety of technologies\r\nShould have designed at least one project module using object oriented analysis and design techniques\r\nSound knowledge of modern software architecture and development techniques\r\n\r\n\r\nEducation:  Graduation or higher in Computer Science or related field.\r\n\r\n\r\n\r\n\r\n', 1, '', '', 1, 1, '', '', '', '', 0, 1, 1, '0', 1218, '2016-05-20 11:00:53', 2, '2016-08-28 16:30:12'),
